FeedPackage.ReleaseNotes:
+ The QB.Web.Application.getProcedureParameters has been added to redefine default prompt for procedure parameters. It must accept the name of procedure name and callback function to return parameters string:
QB.Web.Application.getProcedureParameters = function(procName, callback) {
   var params = prompt("Add params for " + procName);
   callback(params);
}
+ The new Canvas.LinkColor property has been added to specify the color of link lines on the Design Pane.
= MVC5 demos dependencies are targeted to the .NET 4.5 Framework.
- The bug in the Metadata Structure demo has been fixed.

- The bug with validation of a query that contains recursive CTE has been fixed.
+ The new QB.Web.CriteriaBuilder.Events.CriteriaBuilderChanged event lets check the state of the Criteria Builder control.
  QB.Web.Application.CriteriaBuilder.on(
    QB.Web.CriteriaBuilder.Events.CriteriaBuilderChanged, 
      function (event, args) {
        // checks if all conditions are valid (have the necessary values set)
        var isValid = args.criteriaBuilder.isValid(); 
      }
  );
= The Query Results demos have been improved.

FeedPackage.Description:
Основными особенностями ActivityManager являются:
- Независимость от источника данных: поддерживаются все СУБД, для которых существуют провайдеры .Net, и не только;
- Формирование шаблонов без использования COM: все отчеты формируются непосредственно в XML;
- Поддержка форматов отчетов ods, odt, docx, xlsx. Независимость от наличия текстового процессора на конечном компьютере пользователя: эта особенность вытекает из предыдущей;
- Наличие механизмов пред-обработки данных: изменение формата представления ФИО, денежных сумм, целых, вещественных чисел и дат, в том числе и возможность изменения падежа, в котором должны быть представлены конечные данные;
- Наличие механизмов пост-форматирования данных;
- Простота использования и расширения благодаря наличию редактора конфигурации отчетов и простой плагинной архитектуре.

ActivityManager - это менеджер формирования отчетов, базирующийся на замене шаблонных строк.
Основными особенностями ActivityManager являются:
- Независимость от источника данных: поддерживаются все СУБД, для которых существуют провайдеры .Net, и не только;
- Формирование шаблонов без использования COM: все отчеты формируются непосредственно в XML;
- Поддержка форматов отчетов ods, odt, docx, xlsx. Независимость от наличия текстового процессора на конечном компьютере пользователя: эта особенность вытекает из предыдущей;
- Наличие механизмов пред-обработки данных: изменение формата представления ФИО, денежных сумм, целых, вещественных чисел и дат, в том числе и возможность изменения падежа, в котором должны быть представлены конечные данные;
- Наличие механизмов пост-форматирования данных;
- Простота использования и расширения благодаря наличию редактора конфигурации отчетов и простой плагинной архитектуре.

